import React from 'react';

import styles from '../../styles/main';

class NavBar extends React.Component {

    render() {
        return (
            <div className="navbar">

                <h1>Hello World!</h1>

                <div className="links">

                    <li>
                        <Link href="/pageOne" >
                            <a title="page One"> Page One</a>
                        </Link>
                    </li>

                    <li>
                        <Link href="/pageTwo" >
                            <a title="page Two">Page Two</a>
                        </Link>
                    </li>

                    <li>
                        <Link href="/pageThree" >
                            <a title="page Three">Page Three</a>
                        </Link>
                    </li>

                </div>

            </div>
        )
    }

}

export default NavBar;
